import { Box } from "@chakra-ui/react";
import React from "react";


const About = () => {
  return (

    <Box h='100vh'>

    <div  id="about" class="about section" >
      <h1 >
        About
      </h1>
    </div>
    </Box>
  );
};

export default About;
